import React, {Component} from 'react';

class App extends Component {

    constructor(props){
        super(props);
        this.state = {
            contacts: ''
        }
    }

    componentDidMount() {
        fetch('http://jsonplaceholder.typicode.com/users')
        .then(res => res.json())
        .then((data) => {
          this.setState({ contacts: data })
        })
        .catch(console.log)
    }

    render () {
        return (
            <p>{this.state.contacts}</p>
        );
    }
}

export default App;
